INSERT INTO `admin_operation_log` VALUES ('192', '1', 'admin/places/4', 'PUT', '180.175.17.8', '{\"name\":\"Ontario\",\"price\":\"3312\",\"location\":\"Killarney Provincial Park\",\"stars\":\"4\",\"people\":\"5\",\"selected_people\":\"3\",\"description\":\"<p><a href=\\\"https:\\/\\/www.thespruceeats.com\\/introduction-to-cassava-yuca-2138084\\\" data-component=\\\"link\\\" data-source=\\\"inlineLink\\\" data-type=\\\"internalLink\\\" data-ordinal=\\\"1\\\" style=\\\"box-sizing: border-box; text-decoration-line: none; background-image: linear-gradient(to right, rgb(0, 143, 185) 0px, rgb(0, 143, 185) 100%); background-position: 0px 97%; background-repeat: repeat-x; background-size: 100% 1px; color: rgb(0, 143, 185); transition: background-image 0.25s ease 0s, color 0.25s ease 0s; font-family: &quot;Work Sans&quot;, Arial, sans-serif; font-size: 17px; letter-spacing: -0.1px; white-space: normal; background-color: rgb(255, 255, 255);\\\">Yuca<\\/a><span style=\\\"font-family: &quot;Work Sans&quot;, Arial, sans-serif; font-size: 17px; letter-spacing: -0.1px; background-color: rgb(255, 255, 255);\\\">&nbsp;is a starchy root vegetable popular in Hispanic, Latin, and Caribbean cuisine. Used as an accompaniment for grilled meat or saucy preparations, yuca, also known as&nbsp;<\\/span><a href=\\\"https:\\/\\/www.thespruceeats.com\\/introduction-to-cassava-yuca-2138084\\\" data-component=\\\"link\\\" data-source=\\\"inlineLink\\\" data-type=\\\"internalLink\\\" data-ordinal=\\\"2\\\" style=\\\"box-sizing: border-box; text-decoration-line: none; background-image: linear-gradient(to right, rgb(0, 143, 185) 0px, rgb(0, 143, 185) 100%); background-position: 0px 97%; background-repeat: repeat-x; background-size: 100% 1px; color: rgb(0, 143, 185); transition: background-image 0.25s ease 0s, color 0.25s ease 0s; font-family: &quot;Work Sans&quot;, Arial, sans-serif; font-size: 17px; letter-spacing: -0.1px; white-space: normal; background-color: rgb(255, 255, 255);\\\">cassava<\\/a><span style=\\\"font-family: &quot;Work Sans&quot;, Arial, sans-serif; font-size: 17px; letter-spacing: -0.1px; background-color: rgb(255, 255, 255);\\\">, can play the part of potatoes in pretty much any dish you can think of. By simply peeling, boiling, and mashing yuca, you&#39;ll have a delicious dish on your table that can serve as a side to stews or&nbsp;<\\/span><a href=\\\"https:\\/\\/www.thespruceeats.com\\/marinated-rump-roast-3058682\\\" data-component=\\\"link\\\" data-source=\\\"inlineLink\\\" data-type=\\\"internalLink\\\" data-ordinal=\\\"3\\\" style=\\\"box-sizing: border-box; text-decoration-line: none; background-image: linear-gradient(to right, rgb(0, 143, 185) 0px, rgb(0, 143, 185) 100%); background-position: 0px 97%; background-repeat: repeat-x; background-size: 100% 1px; color: rgb(0, 143, 185); transition: background-image 0.25s ease 0s, color 0.25s ease 0s; font-family: &quot;Work Sans&quot;, Arial, sans-serif; font-size: 17px; letter-spacing: -0.1px; white-space: normal; background-color: rgb(255, 255, 255);\\\">roasts<\\/a><span style=\\\"font-family: &quot;Work Sans&quot;, Arial, sans-serif; font-size: 17px; letter-spacing: -0.1px; background-color: rgb(255, 255, 255);\\\">&nbsp;beautifully.<\\/span><\\/p>\",\"_token\":\"RprprYTMQrKhj8cfk01DwqwkClMUGlw6yawxZK78\",\"_method\":\"PUT\",\"_previous_\":\"https:\\/\\/shop.dbestech.com\\/admin\\/places\"}', '2021-12-23 07:07:49', '2021-12-23 07:07:49');
