INSERT INTO `admin_operation_log` VALUES ('201', '1', 'admin/places/4', 'PUT', '180.175.17.8', '{\"name\":\"Bitter Orange Marinade\",\"price\":\"33\",\"location\":\"Killarney Provincial Park\",\"stars\":\"4\",\"people\":\"5\",\"selected_people\":\"3\",\"description\":\"<p id=\\\"mntl-sc-block_1-0\\\" class=\\\"comp mntl-sc-block mntl-sc-block-html\\\" style=\\\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; padding: 0px; letter-spacing: -0.1px; counter-reset: section 0; font-family: &quot;Work Sans&quot;, Arial, sans-serif; font-size: 17px; white-space: normal; background-color: rgb(255, 255, 255);\\\">Bitter oranges are often used in Caribbean cuisine as a breakdown agent in marinades. Sometimes called sour oranges, they add a unique citrus flavor to any kind of meat you might want to prepare. This marinade recipe goes well with pork, and I&#39;ve also used it with chicken with great results.<\\/p><p id=\\\"mntl-sc-block_1-0-2\\\" class=\\\"comp mntl-sc-block mntl-sc-block-html\\\" style=\\\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; padding: 0px; letter-spacing: -0.1px; counter-reset: section 0; font-family: &quot;Work Sans&quot;, Arial, sans-serif; font-size: 17px; white-space: normal; background-color: rgb(255, 255, 255);\\\">Bitter oranges grow on trees\\u2014specifically the&nbsp;<em style=\\\"box-sizing: border-box;\\\">citrus aurantium&nbsp;<\\/em>tree. Their fruit is much sourer than regular oranges and, as the name suggests, they&#39;re bitter. The flesh carries a hint of an aftertaste when it&#39;s eaten raw. Bitter oranges are uglier than regular oranges, with thick, rough skin.&nbsp;<\\/p><p><br\\/><\\/p>\",\"_token\":\"RprprYTMQrKhj8cfk01DwqwkClMUGlw6yawxZK78\",\"_method\":\"PUT\",\"_previous_\":\"https:\\/\\/shop.dbestech.com\\/admin\\/places\"}', '2021-12-23 07:15:25', '2021-12-23 07:15:25');
