rgin-top: 0px; margin-bottom: 0px; padding: 0px; letter-spacing: -0.1px; display: inline-block;\\\"><span data-ingredient-quantity=\\\"true\\\" style=\\\"box-sizing: border-box;\\\">3<\\/span>&nbsp;<span data-ingredient-unit=\\\"true\\\" style=\\\"box-sizing: border-box;\\\">tablespoons<\\/span>&nbsp;<a href=\\\"https:\\/\\/www.thespruceeats.com\\/types-of-olive-oil-1807855\\\" data-component=\\\"link\\\" data-source=\\\"inlineLink\\\" data-type=\\\"internalLink\\\" data-ordinal=\\\"1\\\" style=\\\"box-sizing: border-box; text-decoration-line: none; background-image: linear-gradient(to right, rgb(0, 143, 185) 0px, rgb(0, 143, 185) 100%); background-position: 0px 97%; background-repeat: repeat-x; background-size: 100% 1px; color: rgb(0, 143, 185); transition: background-image 0.25s ease 0s, color 0.25s ease 0s;\\\"><span data-ingredient-name=\\\"true\\\" style=\\\"box-sizing: border-box;\\\">olive oil<\\/span><\\/a><\\/p><\\/li><li><p style=\\\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0px; padding: 0px; letter-spacing: -0.1px; display: inline-block;\\\"><span data-ingredient-quantity=\\\"true\\\" style=\\\"box-sizing: border-box;\\\">3&nbsp;<\\/span><span data-ingredient-unit=\\\"true\\\" style=\\\"box-sizing: border-box;\\\">tablespoons<\\/span>&nbsp;finely chopped&nbsp;<span data-ingredient-name=\\\"true\\\" style=\\\"box-sizing: border-box;\\\">fresh oregano leaves<\\/span><\\/p><\\/li><li><p style=\\\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0px; padding: 0px; letter-spacing: -0.1px; display: inline-block;\\\"><span data-ingredient-quantity=\\\"true\\\" style=\\\"box-sizing: border-box;\\\">1<\\/span>&nbsp;<span data-ingredient-name=\\\"true\\\" style=\\\"box-sizing: border-box;\\\">bay<\\/span>&nbsp;<span data-ingredient-unit=\\\"true\\\" style=\\\"box-sizing: border-box;\\\">leaf<\\/span>, preferably fresh, finely chopped<\\/p><\\/li><li><p style=\\\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0px; padding: 0px; letter-spacing: -0.1px; display: inline-block;\\\"><span data-ingredient-quantity=\\\"true\\\" style=\\\"box-sizing: border-box;\\\">1\\/4<\\/span>&nbsp;<span data-ingredient-unit=\\\"true\\\" style=\\\"box-sizing: border-box;\\\">teaspoon<\\/span>&nbsp;<span data-ingredient-name=\\\"true\\\" style=\\\"box-sizing: border-box;\\\">ground cumin<\\/span><\\/p><\\/li><li><p style=\\\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0px; padding: 0px; letter-spacing: -0.1px; display: inline-block;\\\"><span data-ingredient-name=\\\"true\\\" style=\\\"box-sizing: border-box;\\\">Salt<\\/span>,<span data-ingredient-quantity=\\\"true\\\" style=\\\"box-sizing: border-box;\\\">&nbsp;to taste<\\/span><\\/p><\\/li><\\/ul><p><br\\/><\\/p><ul style=\\\"list-style-type: none;\\\" class=\\\" list-paddingleft-2\\\"><li><p>You can make a passable substitute for sour orange juice by combining two parts regular orange juice with one part lemon juice and one part lime juice. Or, as an alternative, try two parts orange juice with one part grapefruit juice and a teaspoon of lime juice.<\\/p><\\/li><li><p>Add minced&nbsp;<a href=\\\"https:\\/\\/www.thespruceeats.com\\/hot-chile-peppers-scoville-scale-1807552\\\" data-component=\\\"link\\\" data-source=\\\"inlineLink\\\" data-type=\\\"internalLink\\\" data-ordinal=\\\"1\\\" style=\\\"box-sizing: border-box; text-decoration-line: none; background-image: linear-gradient(to right, rgb(0, 143, 185) 0px, rgb(0, 143, 185) 100%); background-position: 0px 97%; background-repeat: repeat-x; background-size: 100% 1px; color: rgb(0, 143, 185); transition: background-image 0.25s ease 0s, color 0.25s ease 0s;\\\">hot peppers<\\/a>&nbsp;if you prefer a spicier marinade.&nbsp;<\\/p><\\/li><li><p>You can substitute one or more different fresh herbs for the oregano; thyme and sage are both good options.<\\/p><\\/li><\\/ul><p><br\\/><\\/p>\",\"_token\":\"RprprYTMQrKhj8cfk01DwqwkClMUGlw6yawxZK78\",\"_method\":\"PUT\",\"_previous_\":\"https:\\/\\/shop.dbestech.com\\/admin\\/places\"}', '2021-12-23 09:01:16', '2021-12-23 09:01:16');
