INSERT INTO `admin_operation_log` VALUES ('217', '1', 'admin/places', 'POST', '58.39.14.207', '{\"name\":\"Creole Rice Side Dish Recipe\",\"price\":\"12\",\"location\":\"china\",\"stars\":\"4\",\"people\":\"3\",\"selected_people\":\"3\",\"description\":\"<h2 id=\\\"mntl-sc-block_1-0-2\\\" class=\\\"comp mntl-sc-block lifestyle-sc-block-heading mntl-sc-block-heading\\\" style=\\\"box-sizing: border-box; margin: 1rem 0px 0.25rem; padding: 0px; font-weight: 500; font-size: 1.5rem; line-height: 1.25; font-family: &quot;Work Sans&quot;, Arial, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\\\"><span class=\\\"mntl-sc-block-heading__text\\\" style=\\\"box-sizing: border-box;\\\">Creole and Cajun Cookery<\\/span><\\/h2><p id=\\\"mntl-sc-block_1-0-3\\\" class=\\\"comp mntl-sc-block mntl-sc-block-html\\\" style=\\\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; padding: 0px; letter-spacing: -0.1px; counter-reset: section 0; font-family: &quot;Work Sans&quot;, Arial, sans-serif; font-size: 17px; white-space: normal; background-color: rgb(255, 255, 255);\\\">Creoles&nbsp;refer to the original European\\u2014particularly French and Spanish\\u2014settlers of New Orleans who were mostly from wealthy families, and who brought their personal chefs from Paris, Madrid, and other European capitals. Since many of the ingredients they traditionally used were unavailable locally, they adapted their recipes to include native Louisiana&nbsp;ingredients like shellfish&nbsp;<a href=\\\"https:\\/\\/www.thespruceeats.com\\/about-red-snapper-334338\\\" data-component=\\\"link\\\" data-source=\\\"inlineLink\\\" data-type=\\\"internalLink\\\" data-ordinal=\\\"1\\\" rel=\\\"noopener noreferrer\\\" style=\\\"box-sizing: border-box; text-decoration-line: none; background-image: linear-gradient(to right, rgb(0, 143, 185) 0px, rgb(0, 143, 185) 100%); background-position: 0px 97%; background-repeat: repeat-x; background-size: 100% 1px; color: rgb(0, 143, 185); transition: background-image 0.25s ease 0s, color 0.25s ease 0s;\\\">snapper<\\/a>, pompano, alligator, meats, game, and squash like cushaw and mirliton (chayote), sugar cane, and pecans. Add to that the cooking tips and seasonings from the native Indians, Caribbean, and African cooks, and this new style of <a href=\\\"https:\\/\\/www.thespruceeats.com\\/what-is-an-andouille-995561\\\" data-component=\\\"link\\\" data-source=\\\"inlineLink\\\" data-type=\\\"internalLink\\\" data-ordinal=\\\"2\\\" rel=\\\"noopener noreferrer\\\" style=\\\"box-sizing: border-box; text-decoration-line: none; background-image: linear-gradient(to right, rgb(0, 143, 185) 0px, rgb(0, 143, 185) 100%); background-position: 0px 97%; background-repeat: repeat-x; background-size: 100% 1px; color: rgb(0, 143, 185); transition: background-image 0.25s ease 0s, color 0.25s ease 0s;\\\">Creole cooking<\\/a>&nbsp;was born.<\\/p>\",\"_token\":\"Ezpf15qYXuW1IU9oXWCFIG9Azk9Rheatu0T51w0M\",\"_previous_\":\"https:\\/\\/shop.dbestech.com\\/admin\\/places\"}', '2021-12-23 15:03:24', '2021-12-23 15:03:24');
