INSERT INTO `admin_operation_log` VALUES ('220', '1', 'admin/places', 'POST', '58.39.14.207', '{\"name\":\"Cuban Fufu\",\"price\":\"10\",\"location\":\"Cuba\",\"stars\":\"5\",\"people\":\"0\",\"selected_people\":\"0\",\"description\":\"<p><span style=\\\"font-family: &quot;Work Sans&quot;, Arial, sans-serif; font-size: 17px; letter-spacing: -0.1px; background-color: rgb(255, 255, 255);\\\">Plantains are a popular ingredient in the Caribbean and are prepared in a variety of ways, similar to how potatoes are used in the United States. The tropical fruit can be incorporated into recipes when it is green as well as when it has ripened. One popular way to use&nbsp;<\\/span><a href=\\\"https:\\/\\/www.thespruceeats.com\\/introduction-to-plantains-2137973\\\" data-component=\\\"link\\\" data-source=\\\"inlineLink\\\" data-type=\\\"internalLink\\\" data-ordinal=\\\"1\\\" rel=\\\"noopener noreferrer\\\" style=\\\"box-sizing: border-box; text-decoration-line: none; background-image: linear-gradient(to right, rgb(0, 143, 185) 0px, rgb(0, 143, 185) 100%); background-position: 0px 97%; background-repeat: repeat-x; background-size: 100% 1px; color: rgb(0, 143, 185); transition: background-image 0.25s ease 0s, color 0.25s ease 0s; font-family: &quot;Work Sans&quot;, Arial, sans-serif; font-size: 17px; letter-spacing: -0.1px; white-space: normal; background-color: rgb(255, 255, 255);\\\">plantains<\\/a><span style=\\\"font-family: &quot;Work Sans&quot;, Arial, sans-serif; font-size: 17px; letter-spacing: -0.1px; background-color: rgb(255, 255, 255);\\\">&nbsp;is in a stuffing; in Puerto Rico green plantains are made into&nbsp;<\\/span><a href=\\\"https:\\/\\/www.thespruceeats.com\\/traditional-mofongo-recipe-2138186\\\" data-component=\\\"link\\\" data-source=\\\"inlineLink\\\" data-type=\\\"internalLink\\\" data-ordinal=\\\"2\\\" rel=\\\"noopener noreferrer\\\" style=\\\"box-sizing: border-box; text-decoration-line: none; background-image: linear-gradient(to right, rgb(0, 143, 185) 0px, rgb(0, 143, 185) 100%); background-position: 0px 97%; background-repeat: repeat-x; background-size: 100% 1px; color: rgb(0, 143, 185); transition: background-image 0.25s ease 0s, color 0.25s ease 0s; font-family: &quot;Work Sans&quot;, Arial, sans-serif; font-size: 17px; letter-spacing: -0.1px; white-space: normal; background-color: rgb(255, 255, 255);\\\">mofongo<\\/a><span style=\\\"font-family: &quot;Work Sans&quot;, Arial, sans-serif; font-size: 17px; letter-spacing: -0.1px; background-color: rgb(255, 255, 255);\\\">&nbsp;and in Cuba, the stuffing is made with ripe plantains and called fufu.<\\/span><\\/p>\",\"_token\":\"Ezpf15qYXuW1IU9oXWCFIG9Azk9Rheatu0T51w0M\",\"_previous_\":\"https:\\/\\/shop.dbestech.com\\/admin\\/places\"}', '2021-12-23 15:04:49', '2021-12-23 15:04:49');
