INSERT INTO `order_details` VALUES ('545', '100011', '3', '34.00', '{\"id\":3,\"name\":\"Chinese Side\",\"description\":\"<p style=\\\"border: 0px; margin-top: 0px; margin-bottom: 1.3em; padding: 0px; line-height: 1.8; color: rgb(58, 58, 58); font-family: Montserrat, sans-serif; font-size: 20px; white-space: normal; background-color: rgb(255, 255, 255);\\\">Enjoy these flavors any time of day.<\\/p><p><br\\/><\\/p>\",\"price\":34,\"stars\":3,\"people\":5,\"selected_people\":4,\"img\":\"images\\/fe978d4b2a6e311efc53370bad41c302.jpg\",\"location\":\"Moraine Lake, Alberta\",\"created_at\":\"2021-11-17 10:16:31\",\"updated_at\":\"2022-05-16 11:49:24\",\"type_id\":3}', '2', '10.00', '2022-06-03 07:33:28', '2022-06-03 07:33:28');
INSERT INTO `order_details` VALUES ('546', '100011', '6', '18.00', '{\"id\":6,\"name\":\"Creole Rice Side Dish Recipe\",\"description\":\"<p style=\\\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 17px; line-height: inherit; font-family: Karla, Helvetica, Arial, Verdana, sans-serif; vertical-align: baseline; color: rgb(38, 38, 38); white-space: normal; background-color: rgb(255, 255, 255);\\\">The quality and craftsmanship is on full show. The waiters&#39; signature white tunics are of loosely rumpled linen here versus the crisp whites of the city. The thick galleria walls of the restaurant&#39;s three distinct areas are cast in gentle neon so that even your worst&nbsp;wine-fuelled photos turn into atmospheric still lifes. The art, typically, lands a gut punch.<\\/p><p style=\\\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 17px; line-height: inherit; font-family: Karla, Helvetica, Arial, Verdana, sans-serif; vertical-align: baseline; color: rgb(38, 38, 38); white-space: normal; background-color: rgb(255, 255, 255);\\\">From the Bill Henson portraits at the St Kilda restaurant to Shaun Gladwell&#39;s beautiful video artworks at Citta, Di Stasio doesn&#39;t use pieces to decorate but to provoke. On entry, a bronze cast of Di Stasio&#39;s hands jutt out of the wall, immortalised in the sign of the bull \\u2013 equal parts a rock star welcome and a warning. A trio of powerful works by Kamilaroi artist Reko Rennie, titled&nbsp;<em style=\\\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\\\">Genesis<\\/em>, goes straight for the jugular of unceded sovereignty.<\\/p><p><br\\/><\\/p>\",\"price\":18,\"stars\":4,\"people\":3,\"selected_people\":3,\"img\":\"images\\/d6648f1f920d6bbc89988d75b3bed5b3.jpg\",\"location\":\"china\",\"created_at\":\"2021-12-23 15:03:24\",\"updated_at\":\"2022-01-21 10:28:04\",\"type_id\":2}', '2', '10.00', '2022-06-03 07:33:28', '2022-06-03 07:33:28');
INSERT INTO `order_details` VALUES ('547', '100011', '10', '12.00', '{\"id\":10,\"name\":\"Chicken biriani\",\"description\":\"<p><span style=\\\"color: rgb(17, 17, 17); font-family: -apple-system, &quot;system-ui&quot;, &quot;Segoe UI&quot;, Roboto, Oxygen-Sans, Ubuntu, Cantarell, &quot;Fira Sans&quot;, &quot;Droid Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, &quot;\\u30d2\\u30e9\\u30ae\\u30ce\\u89d2\\u30b4 Pro W3&quot;, &quot;Hiragino Kaku Gothic Pro&quot;, \\u30e1\\u30a4\\u30ea\\u30aa, Meiryo, &quot;\\uff2d\\uff33 \\uff30\\u30b4\\u30b7\\u30c3\\u30af&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 14px; background-color: rgb(255, 255, 255);\\\">Chicken Biryani Served in a Bowl Close Up Photo. Indian Food, Indian Style Rice and Chicken. #Biryani #ChickenBiryani #IndianFood #StockPhoto<\\/span><\\/p>\",\"price\":12,\"stars\":4,\"people\":3,\"selected_people\":3,\"img\":\"images\\/9447a79793a4b7f832d981f975c0abc4.jpeg\",\"location\":\"china\",\"created_at\":\"2021-12-27 06:29:47\",\"updated_at\":\"2022-01-01 08:56:33\",\"type_id\":2}', '2', '10.00', '2022-06-03 07:33:28', '2022-06-03 07:33:28');
